import { StyleSheet } from "react-native";

const Styles = StyleSheet.create({
  rootView: {
    justifyContent: "center",
    alignItems: "center",
    alignContent: "center",
    marginRight: 10,
  },

  pressable: {
    justifyContent: "center",
    alignItems: "center",
    alignContent: "center",
  },
});

export default Styles;
